import React, {Component} from "react";

export default class FancyBorder extends Component {
    render() {
        const fancyBorder = props => (
            <div className={'FancyBorder FancyBorder-' + props.color}>
                {props.children}
            </div>
        );

        return (
            <div>{fancyBorder}</div>
        );
    };
};
